import React, { Component } from 'react';
import { View, Text, SafeAreaView, ScrollView } from 'react-native';
import styles from '../../styles/Style_NotificationsScreen';
import { ListItem, Divider } from 'react-native-elements'
import colors from '../../constants/Colors';

class NotificationsScreen extends Component {
  constructor(props) {
    super(props);
    this.state = {
    };
    this.renderHour = this.renderHour.bind(this);
  }

  renderHour() {
    return(
        <Text style={{ fontSize: 12, fontWeight: '400', color: colors.gray02, opacity: 0.6, }}>4h</Text>
    )
  }

  render() {
    return (
        <SafeAreaView style={styles.container}>
            <ScrollView style={styles.container} showsVerticalScrollIndicator={false}>
                <Text style={styles.headline}>Notifications</Text>
                <Text style={styles.secondaryHeadline}>New</Text>
                {
                    list.map((item, index) => (
                        <ListItem
                            key={index}
                            chevron={this.renderHour}
                            leftAvatar={{ source: { uri: item.avatar_url }, size: 60 }}
                            title={item.name}
                            titleStyle={{ fontWeight: '600', fontSize: 14 }}
                            subtitle={item.subtitle}
                            subtitleStyle={{ fontWeight: '400', fontSize: 12 }}
                            topDivider={item.new === true ? false : true }
                            containerStyle={{ backgroundColor: item.new === true ? 'rgba(237, 136, 136, 0.35)' : 'white' }}
                        />
                    ))
                }
                <Divider style={{ backgroundColor: colors.gray03, marginVertical: 25, marginHorizontal: 18, height: 0.8 }} />
                <Text style={styles.secondaryHeadline}>Earlier</Text>
                {
                    list.map((item, index) => (
                        <ListItem
                            key={index}
                            chevron={this.renderHour}
                            leftAvatar={{ source: { uri: item.avatar_url }, size: 60 }}
                            title={item.name}
                            titleStyle={{ fontWeight: '600', fontSize: 14 }}
                            subtitle={item.subtitle}
                            subtitleStyle={{ fontWeight: '400', fontSize: 12 }}
                            topDivider={index === 0 ? false : true }
                            containerStyle={{ backgroundColor: 'white' }}
                        />
                    ))
                }
            </ScrollView>
        </SafeAreaView>
    );
  }
}

export default NotificationsScreen;


